(6314,592,'el','2023-09-06 11:22:23.164787','2023-09-09 10:49:11.693506',' αναλύουν, για ποιους λόγους επεξεργαζόμαστε τα δεδομένα σας, και για ποιο σκοπό τα αξιοποιούμε. Για λόγους προστασίας δεδομένων, θα σας ζητηθεί να επιβεβαιώσετε την εγγραφή σας μέσω e-mail. '),
